longest = 0
start = 0
temp = 0
dict = {}
for i in range(len(s)):
    if s[i] in dict and dict[s[i]] >= start:
        start = dict[s[i]] + 1
    temp = i - start + 1
    dict[s[i]] = i
    longest = max(longest,temp)
